import{_ as e,o as t,c as o,O as r}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 58.1-602 (Effective October 1, 2022) Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/58.1-602.md","filePath":"vacode/58.1-602.md"}'),a={name:"vacode/58.1-602.md"},i=r('<h1 id="§-58-1-602-effective-october-1-2022-definitions" tabindex="-1">§ 58.1-602 (Effective October 1, 2022) Definitions. <a class="header-anchor" href="#§-58-1-602-effective-october-1-2022-definitions" aria-label="Permalink to &quot;§ 58.1-602 (Effective October 1, 2022) Definitions.&quot;">​</a></h1><p>As used in this chapter, unless the context clearly shows otherwise:</p><p>&quot;Accommodations&quot; means any room or rooms, lodgings, or accommodations in any hotel, motel, inn, tourist camp, tourist cabin, camping grounds, club, short-term rental, or any other place in which rooms, lodging, space, or accommodations are regularly furnished to transients for a consideration. &quot;Accommodations&quot; does not include rooms or space offered by a person in the business of providing conference rooms, meeting space, or event space if the person does not also offer rooms available for overnight sleeping.</p><p>&quot;Accommodations fee&quot; means the room charge less the discount room charge, if any, provided that the accommodations fee shall not be less than $0.</p><p>&quot;Accommodations intermediary&quot; means any person other than an accommodations provider that (i) facilitates the sale of an accommodation and (ii) either (a) charges a room charge to the customer, and charges an accommodations fee to the customer, which fee it retains as compensation for facilitating the sale; (b) collects a room charge from the customer; or (c) charges a fee, other than an accommodations fee, to the customer, which fee it retains as compensation for facilitating the sale. For purposes of this definition, &quot;facilitates the sale&quot; includes brokering, coordinating, or in any other way arranging for the purchase of the right to use accommodations via a transaction directly, including via one or more payment processors, between a customer and an accommodations provider.</p><p>&quot;Accommodations intermediary&quot; does not include a person:</p><ol><li><p>If the accommodations are provided by an accommodations provider operating under a trademark, trade name, or service mark belonging to such person;</p></li><li><p>Who facilitates the sale of an accommodation if (i) the price paid by the customer to such person is equal to the price paid by such person to the accommodations provider for the use of the accommodations and (ii) the only compensation received by such person for facilitating the sale of the accommodation is a commission paid from the accommodations provider to such person; or</p></li><li><p>Who is licensed as a real estate licensee pursuant to Article 1 (§ <a href="/vacode/54.1-2100/">54.1-2100</a> et seq.) of Chapter 21 of Title 54.1, when acting within the scope of such license.</p></li></ol><p>&quot;Accommodations provider&quot; means any person that furnishes accommodations to the general public for compensation. The term &quot;furnishes&quot; includes the sale of use or possession or the sale of the right to use or possess.</p><p>&quot;Advertising&quot; means the planning, creating, or placing of advertising in newspapers, magazines, billboards, broadcasting and other media, including, without limitation, the providing of concept, writing, graphic design, mechanical art, photography and production supervision. Any person providing advertising as defined in this section shall be deemed to be the user or consumer of all tangible personal property purchased for use in such advertising.</p><p>&quot;Affiliate&quot; means the same as such term is defined in § <a href="/vacode/58.1-439.18/">58.1-439.18</a>.</p><p>&quot;Amplification, transmission, distribution, and network equipment&quot; means production, distribution, and other equipment used to provide Internet-access services, such as computer and communications equipment and software used for storing, processing, and retrieving end-user subscribers&#39; requests. A &quot;network&quot; includes modems, fiber optic cables, coaxial cables, radio equipment, routing equipment, switching equipment, a cable modem termination system, associated software, transmitters, power equipment, storage devices, servers, multiplexers, and antennas, which network is used to provide Internet service, regardless of whether the provider of such service is also a telephone common carrier or whether such network is also used to provide services other than Internet services.</p><p>&quot;Business&quot; includes any activity engaged in by any person, or caused to be engaged in by him, with the object of gain, benefit or advantage, either directly or indirectly.</p><p>&quot;Cost price&quot; means the actual cost of an item or article of tangible personal property computed in the same manner as the sales price as defined in this section without any deductions therefrom on account of the cost of materials used, labor, or service costs, transportation charges, or any expenses whatsoever.</p><p>&quot;Custom program&quot; means a computer program that is specifically designed and developed only for one customer. The combining of two or more prewritten programs does not constitute a custom computer program. A prewritten program that is modified to any degree remains a prewritten program and does not become custom.</p><p>&quot;Discount room charge&quot; means the full amount charged by the accommodations provider to the accommodations intermediary, or an affiliate thereof, for furnishing the accommodations.</p><p>&quot;Distribution&quot; means the transfer or delivery of tangible personal property for use, consumption, or storage by the distributee, and the use, consumption, or storage of tangible personal property by a person that has processed, manufactured, refined, or converted such property, but does not include the transfer or delivery of tangible personal property for resale or any use, consumption, or storage otherwise exempt under this chapter.</p><p>&quot;Gross proceeds&quot; means the charges made or voluntary contributions received for the lease or rental of tangible personal property or for furnishing services, computed with the same deductions, where applicable, as for sales price as defined in this section over the term of the lease, rental, service, or use, but not less frequently than monthly. &quot;Gross proceeds&quot; does not include finance charges, carrying charges, service charges, or interest from credit extended on the lease or rental of tangible personal property under conditional lease or rental contracts or other conditional contracts providing for the deferred payments of the lease or rental price.</p><p>&quot;Gross sales&quot; means the sum total of all retail sales of tangible personal property or services as defined in this chapter, without any deduction, except as provided in this chapter. &quot;Gross sales&quot; does not include the federal retailers&#39; excise tax or the federal diesel fuel excise tax imposed in § 4091 of the Internal Revenue Code if the excise tax is billed to the purchaser separately from the selling price of the article, or the Virginia retail sales or use tax, or any sales or use tax imposed by any county or city under § <a href="/vacode/58.1-605/">58.1-605</a> or <a href="/vacode/58.1-606/">58.1-606</a>.</p><p>&quot;Import&quot; and &quot;imported&quot; are words applicable to tangible personal property imported into the Commonwealth from other states as well as from foreign countries, and &quot;export&quot; and &quot;exported&quot; are words applicable to tangible personal property exported from the Commonwealth to other states as well as to foreign countries.</p><p>&quot;In this Commonwealth&quot; or &quot;in the Commonwealth&quot; means within the limits of the Commonwealth of Virginia and includes all territory within these limits owned by or ceded to the United States of America.</p><p>&quot;Integrated process,&quot; when used in relation to semiconductor manufacturing, means a process that begins with the research or development of semiconductor products, equipment, or processes, includes the handling and storage of raw materials at a plant site, and continues to the point that the product is packaged for final sale and either shipped or conveyed to a warehouse. Without limiting the foregoing, any semiconductor equipment, fuel, power, energy, supplies, or other tangible personal property shall be deemed used as part of the integrated process if its use contributes, before, during, or after production, to higher product quality, production yields, or process efficiencies. Except as otherwise provided by law, &quot;integrated process&quot; does not mean general maintenance or administration.</p><p>&quot;Internet&quot; means, collectively, the myriad of computer and telecommunications facilities, which comprise the interconnected worldwide network of computer networks that employ the Transmission Control Protocol/Internet Protocol, or any predecessor or successor to such protocol, to communicate information of all kinds by wire or radio.</p><p>&quot;Internet service&quot; means a service that enables users to access content, information, and other services offered over the Internet.</p><p>&quot;Lease or rental&quot; means the leasing or renting of tangible personal property and the possession or use thereof by the lessee or renter for a consideration, without transfer of the title to such property.</p><p>&quot;Manufacturing, processing, refining, or conversion&quot; includes the production line of the plant starting with the handling and storage of raw materials at the plant site and continuing through the last step of production where the product is finished or completed for sale and conveyed to a warehouse at the production site, and also includes equipment and supplies used for production line testing and quality control. &quot;Manufacturing&quot; also includes the necessary ancillary activities of newspaper and magazine printing when such activities are performed by the publisher of any newspaper or magazine for sale daily or regularly at average intervals not exceeding three months.</p><p>The determination of whether any manufacturing, mining, processing, refining or conversion activity is industrial in nature shall be made without regard to plant size, existence or size of finished product inventory, degree of mechanization, amount of capital investment, number of employees or other factors relating principally to the size of the business. Further, &quot;industrial in nature&quot; includes, but is not limited to, those businesses classified in codes 10 through 14 and 20 through 39 published in the Standard Industrial Classification Manual for 1972 and any supplements issued thereafter.</p><p>&quot;Modular building&quot; means, but is not limited to, single and multifamily houses, apartment units, commercial buildings, and permanent additions thereof, comprised of one or more sections that are intended to become real property, primarily constructed at a location other than the permanent site, built to comply with the Virginia Industrialized Building Safety Law (§ <a href="/vacode/36-70/">36-70</a> et seq.) as regulated by the Virginia Department of Housing and Community Development, and shipped with most permanent components in place to the site of final assembly. For purposes of this chapter, &quot;modular building&quot; does not include a mobile office as defined in § <a href="/vacode/58.1-2401/">58.1-2401</a> or any manufactured building subject to and certified under the provisions of the National Manufactured Housing Construction and Safety Standards Act of 1974 (42 U.S.C. § 5401 et seq.).</p><p>&quot;Modular building manufacturer&quot; means a person that owns or operates a manufacturing facility and is engaged in the fabrication, construction and assembling of building supplies and materials into modular buildings, as defined in this section, at a location other than at the site where the modular building will be assembled on the permanent foundation and may or may not be engaged in the process of affixing the modules to the foundation at the permanent site.</p><p>&quot;Modular building retailer&quot; means any person that purchases or acquires a modular building from a modular building manufacturer, or from another person, for subsequent sale to a customer residing within or outside of the Commonwealth, with or without installation of the modular building to the foundation at the permanent site.</p><p>&quot;Motor vehicle&quot; means a &quot;motor vehicle&quot; as defined in § <a href="/vacode/58.1-2401/">58.1-2401</a>, taxable under the provisions of the Virginia Motor Vehicles Sales and Use Tax Act (§ <a href="/vacode/58.1-2400/">58.1-2400</a> et seq.) and upon the sale of which all applicable motor vehicle sales and use taxes have been paid.</p><p>&quot;Occasional sale&quot; means a sale of tangible personal property not held or used by a seller in the course of an activity for which it is required to hold a certificate of registration, including the sale or exchange of all or substantially all the assets of any business and the reorganization or liquidation of any business, provided that such sale or exchange is not one of a series of sales and exchanges sufficient in number, scope and character to constitute an activity requiring the holding of a certificate of registration.</p><p>&quot;Open video system&quot; means an open video system authorized pursuant to 47 U.S.C. § 573 and, for purposes of this chapter only, also includes Internet service regardless of whether the provider of such service is also a telephone common carrier.</p><p>&quot;Person&quot; includes any individual, firm, copartnership, cooperative, nonprofit membership corporation, joint venture, association, corporation, estate, trust, business trust, trustee in bankruptcy, receiver, auctioneer, syndicate, assignee, club, society, or other group or combination acting as a unit, body politic or political subdivision, whether public or private, or quasi-public, and the plural of &quot;person&quot; means the same as the singular.</p><p>&quot;Prewritten program&quot; means a computer program that is prepared, held or existing for general or repeated sale or lease, including a computer program developed for in-house use and subsequently sold or leased to unrelated third parties.</p><p>&quot;Qualifying locality&quot; means Charlotte County, Gloucester County, Halifax County, Henry County, Mecklenburg County, Northampton County, Patrick County, Pittsylvania County, or the City of Danville.</p><p>&quot;Railroad rolling stock&quot; means locomotives, of whatever motive power, autocars, railroad cars of every kind and description, and all other equipment determined by the Tax Commissioner to constitute railroad rolling stock.</p><p>&quot;Remote seller&quot; means any dealer deemed to have sufficient activity within the Commonwealth to require registration under § <a href="/vacode/58.1-613/">58.1-613</a> under the criteria specified in subdivision C 10 or 11 of § <a href="/vacode/58.1-612/">58.1-612</a> or any software provider acting on behalf of such dealer.</p><p>&quot;Retail sale&quot; or a &quot;sale at retail&quot; means a sale to any person for any purpose other than for resale in the form of tangible personal property or services taxable under this chapter, and shall include any such transaction as the Tax Commissioner upon investigation finds to be in lieu of a sale. All sales for resale must be made in strict compliance with regulations applicable to this chapter. Any dealer making a sale for resale which is not in strict compliance with such regulations shall be personally liable for payment of the tax.</p><p>The terms &quot;retail sale&quot; and a &quot;sale at retail&quot; specifically include the following: (i) the sale or charges for any accommodations furnished to transients for less than 90 continuous days; (ii) sales of tangible personal property to persons for resale when because of the operation of the business, or its very nature, or the lack of a place of business in which to display a certificate of registration, or the lack of a place of business in which to keep records, or the lack of adequate records, or because such persons are minors or transients, or because such persons are engaged in essentially service businesses, or for any other reason there is likelihood that the Commonwealth will lose tax funds due to the difficulty of policing such business operations; (iii) the separately stated charge made for automotive refinish repair materials that are permanently applied to or affixed to a motor vehicle during its repair; and (iv) the separately stated charge for equipment available for lease or purchase by a provider of satellite television programming to the customer of such programming. Equipment sold to a provider of satellite television programming for subsequent lease or purchase by the customer of such programming shall be deemed a sale for resale. The Tax Commissioner is authorized to promulgate regulations requiring vendors of or sellers to such persons to collect the tax imposed by this chapter on the cost price of such tangible personal property to such persons and may refuse to issue certificates of registration to such persons. The terms &quot;retail sale&quot; and a &quot;sale at retail&quot; also specifically include the separately stated charge made for supplies used during automotive repairs whether or not there is transfer of title or possession of the supplies and whether or not the supplies are attached to the automobile. The purchase of such supplies by an automotive repairer for sale to the customer of such repair services shall be deemed a sale for resale.</p><p>The term &quot;transient&quot; does not include a purchaser of camping memberships, time-shares, condominiums, or other similar contracts or interests that permit the use of, or constitute an interest in, real estate, however created or sold and whether registered with the Commonwealth or not. Further, a purchaser of a right or license which entitles the purchaser to use the amenities and facilities of a specific real estate project on an ongoing basis throughout its term shall not be deemed a transient, provided, however, that the term or time period involved is for seven years or more.</p><p>The terms &quot;retail sale&quot; and &quot;sale at retail&quot; do not include a transfer of title to tangible personal property after its use as tools, tooling, machinery or equipment, including dies, molds, and patterns, if (i) at the time of purchase, the purchaser is obligated, under the terms of a written contract, to make the transfer and (ii) the transfer is made for the same or a greater consideration to the person for whom the purchaser manufactures goods.</p><p>&quot;Retailer&quot; means every person engaged in the business of making sales at retail, or for distribution, use, consumption, or storage to be used or consumed in the Commonwealth.</p><p>&quot;Room charge&quot; means the full retail price charged to the customer for the use of the accommodations before taxes. &quot;Room charge&quot; includes any fee charged to the customer and retained as compensation for facilitating the sale, whether described as an accommodations fee, facilitation fee, or any other name. The room charge shall be determined in accordance with 23VAC10-210-730 and the related rulings of the Department on the same.</p><p>&quot;Sale&quot; means any transfer of title or possession, or both, exchange, barter, lease or rental, conditional or otherwise, in any manner or by any means whatsoever, of tangible personal property and any rendition of a taxable service for a consideration, and includes the fabrication of tangible personal property for consumers who furnish, either directly or indirectly, the materials used in fabrication, and the furnishing, preparing, or serving for a consideration of any tangible personal property consumed on the premises of the person furnishing, preparing, or serving such tangible personal property. A transaction whereby the possession of property is transferred but the seller retains title as security for the payment of the price shall be deemed a sale.</p><p>&quot;Sales price&quot; means the total amount for which tangible personal property or services are sold, including any services that are a part of the sale, valued in money, whether paid in money or otherwise, and includes any amount for which credit is given to the purchaser, consumer, or lessee by the dealer, without any deduction therefrom on account of the cost of the property sold, the cost of materials used, labor or service costs, losses or any other expenses whatsoever. &quot;Sales price&quot; does not include (i) any cash discount allowed and taken; (ii) finance charges, carrying charges, service charges or interest from credit extended on sales of tangible personal property under conditional sale contracts or other conditional contracts providing for deferred payments of the purchase price; (iii) separately stated local property taxes collected; (iv) that portion of the amount paid by the purchaser as a discretionary gratuity added to the price of a meal; or (v) that portion of the amount paid by the purchaser as a mandatory gratuity or service charge added by a restaurant to the price of a meal, but only to the extent that such mandatory gratuity or service charge does not exceed 20 percent of the price of the meal. Where used articles are taken in trade, or in a series of trades as a credit or part payment on the sale of new or used articles, the tax levied by this chapter shall be paid on the net difference between the sales price of the new or used articles and the credit for the used articles.</p><p>&quot;Semiconductor cleanrooms&quot; means the integrated systems, fixtures, piping, partitions, flooring, lighting, equipment, and all other property used to reduce contamination or to control airflow, temperature, humidity, vibration, or other environmental conditions required for the integrated process of semiconductor manufacturing.</p><p>&quot;Semiconductor equipment&quot; means (i) machinery or tools or repair parts or replacements thereof; (ii) the related accessories, components, pedestals, bases, or foundations used in connection with the operation of the equipment, without regard to the proximity to the equipment, the method of attachment, or whether the equipment or accessories are affixed to the realty; (iii) semiconductor wafers and other property or supplies used to install, test, calibrate or recalibrate, characterize, condition, measure, or maintain the equipment and settings thereof; and (iv) equipment and supplies used for quality control testing of product, materials, equipment, or processes; or the measurement of equipment performance or production parameters regardless of where or when the quality control, testing, or measuring activity takes place, how the activity affects the operation of equipment, or whether the equipment and supplies come into contact with the product.</p><p>&quot;Short-term rental&quot; means the same as such term is defined in § <a href="/vacode/15.2-983/">15.2-983</a>.</p><p>&quot;Storage&quot; means any keeping or retention of tangible personal property for use, consumption or distribution in the Commonwealth, or for any purpose other than sale at retail in the regular course of business.</p><p>&quot;Tangible personal property&quot; means personal property that may be seen, weighed, measured, felt, or touched, or is in any other manner perceptible to the senses. &quot;Tangible personal property&quot; does not include stocks, bonds, notes, insurance or other obligations or securities. &quot;Tangible personal property&quot; includes (i) telephone calling cards upon their initial sale, which shall be exempt from all other state and local utility taxes, and (ii) manufactured signs.</p><p>&quot;Use&quot; means the exercise of any right or power over tangible personal property incident to the ownership thereof, except that it does not include the sale at retail of that property in the regular course of business. &quot;Use&quot; does not include the exercise of any right or power, including use, distribution, or storage, over any tangible personal property sold to a nonresident donor for delivery outside of the Commonwealth to a nonresident recipient pursuant to an order placed by the donor from outside the Commonwealth via mail or telephone. &quot;Use&quot; does not include any sale determined to be a gift transaction, subject to tax under § <a href="/vacode/58.1-604.6/">58.1-604.6</a>.</p><p>&quot;Use tax&quot; refers to the tax imposed upon the use, consumption, distribution, and storage as defined in this section.</p><p>&quot;Used directly,&quot; when used in relation to manufacturing, processing, refining, or conversion, refers to those activities that are an integral part of the production of a product, including all steps of an integrated manufacturing or mining process, but not including ancillary activities such as general maintenance or administration. When used in relation to mining, &quot;used directly&quot; refers to the activities specified in this definition and, in addition, any reclamation activity of the land previously mined by the mining company required by state or federal law.</p><p>&quot;Video programmer&quot; means a person that provides video programming to end-user subscribers.</p><p>&quot;Video programming&quot; means video and/or information programming provided by or generally considered comparable to programming provided by a cable operator, including, but not limited to, Internet service.</p><p>Code 1950, §§ 58-441.2, 58-441.3, 58-441.6; 1966, c. 151; 1972, c. 680; 1973, c. 313; 1974, c. 431; 1976, cc. 375, 489, 666, 712, 764, 770; 1977, cc. 247, 504; 1978, cc. 50, 82, 181, 505, 656, 665, 706, 784, 819; 1979, cc. 148, 205, 555, 556, 557, 558, 561, 562, 564, 572, 575; 1980, cc. 81, 610, 611, 617, 618, 621, 631, 753, 756; 1981, cc. 398, 400, 405, 409, 416, 599; 1982, cc. 533, 546, 547, 636, 649; 1983, cc. 100, 184, 384, 414, 557, 565, 599; 1984, cc. 419, 522, 675, 683, 690, 693; 1985, c. 473; 1986, c. 22; 1988, c. 899; 1989, cc. 581, 739; 1995, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0096" target="_blank" rel="noreferrer">96</a>; 1999, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0138" target="_blank" rel="noreferrer">138</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0187" target="_blank" rel="noreferrer">187</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0723" target="_blank" rel="noreferrer">723</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0981" target="_blank" rel="noreferrer">981</a>; 2000, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0425" target="_blank" rel="noreferrer">425</a>; 2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0060" target="_blank" rel="noreferrer">60</a>; 2005, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0121" target="_blank" rel="noreferrer">121</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0122" target="_blank" rel="noreferrer">122</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0355" target="_blank" rel="noreferrer">355</a>; 2006, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0519" target="_blank" rel="noreferrer">519</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0541" target="_blank" rel="noreferrer">541</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0568" target="_blank" rel="noreferrer">568</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0602" target="_blank" rel="noreferrer">602</a>; 2007, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?071+ful+CHAP0751" target="_blank" rel="noreferrer">751</a>; 2013, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0766" target="_blank" rel="noreferrer">766</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0783" target="_blank" rel="noreferrer">783</a>; 2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0359" target="_blank" rel="noreferrer">359</a>; 2015, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0252" target="_blank" rel="noreferrer">252</a>; 2017, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?171+ful+CHAP0104" target="_blank" rel="noreferrer">104</a>; 2018, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0838" target="_blank" rel="noreferrer">838</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0840" target="_blank" rel="noreferrer">840</a>; 2019, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0815" target="_blank" rel="noreferrer">815</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0816" target="_blank" rel="noreferrer">816</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0854" target="_blank" rel="noreferrer">854</a>; 2020, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0327" target="_blank" rel="noreferrer">327</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0427" target="_blank" rel="noreferrer">427</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0428" target="_blank" rel="noreferrer">428</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0705" target="_blank" rel="noreferrer">705</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0708" target="_blank" rel="noreferrer">708</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0865" target="_blank" rel="noreferrer">865</a>; 2021, Sp. Sess. I, c. <a href="https://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0383" target="_blank" rel="noreferrer">383</a>; 2022, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0007" target="_blank" rel="noreferrer">7</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0154" target="_blank" rel="noreferrer">154</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0434" target="_blank" rel="noreferrer">434</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0435" target="_blank" rel="noreferrer">435</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0640" target="_blank" rel="noreferrer">640</a>.</p>',56),n=[i];function s(l,c,h,p,u,d){return t(),o("div",null,n)}const g=e(a,[["render",s]]);export{m as __pageData,g as default};
